async function applyDataTemplate(e){let t=await document.querySelector("main"),a=!1,c=!1;e.forEach(e=>{switch(e.content_level){case 1:let n=document.createElement("div");n.className+="cv-category home-section shadow-section";let l=document.createElement("h2");l.className+="cv-category-title",l.innerText=e.content,n.append(l),t.append(n),a||(a=!a);break;case 2:if(a){let r=document.createElement("ul");r.className+="cv-content-container",(async()=>{(await t.querySelector(".cv-category:last-child")).append(r)})(),a=!a}let o=document.createElement("li");o.className+="cv-content key",o.innerText=e.content,(async()=>{(await (await t.querySelector(".cv-category:last-child")).querySelector(".cv-content-container:last-child")).append(o)})(),c||(c=!c);break;case 3:if(c){let i=document.createElement("li");i.className+="cv-content-secondary-container";let s=document.createElement("ul");(async()=>{let e=await (await t.querySelector(".cv-category:last-child")).querySelector(".cv-content-container:last-child");i.append(s),e.append(i)})(),c=!c}let y=document.createElement("li");y.className+="cv-content-secondary key",y.innerText=e.content,(async()=>{(await (await (await (await t.querySelector(".cv-category:last-child")).querySelector(".cv-content-container:last-child")).querySelector(".cv-content-secondary-container:last-child")).querySelector("ul")).append(y)})()}})}async function cvDataFetch(){let e=await fetch("/cv/data");e.ok?await applyDataTemplate(await e.json()):console.error("HTTP-Error: "+e.status)}cvDataFetch().then(e=>{e&&console.log(e)});